const CartItemD = ({ item }) => {
  const { title, price, description, image } = item;

  return (
    <div>
          <div className=" bg-red-300 ">
              <h1> {title.length>60?(description.slice(0,50)+'...'):(description)} </h1>
        <p> {description.length>60?(description.slice(0,50)+'...'):(description)} </p>
      </div>
    </div>
  );
};

export default CartItemD;
